import React from 'react'
import Topbar from './Topbar';
import { Container , Row , Col } from 'react-bootstrap';

const Home = props => {

    return (
        <div>
            <Topbar />
            <div>
            <Container>
                 <Col>
                  <Row ><h1>Our Products</h1></Row>
                </Col>
            </Container>
            </div>
        </div>
    )
}

export default Home;
